import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
    return (
        <div className="app">
            <form name="crwaler-form">
                <label htmlFor="crawl">
                    Crawl me:
                    <input id="crwal" type="text" name="input"/>
                </label>
            </form>
            <textarea name="output" id="output" cols="30" rows="10"></textarea>
        </div>
    );
}

export default App;
